import React, { Component } from 'react' ;
import Test1 from './Test1';

class  Hdr extends Component()
{

  constructor(){
    super()
  }

  render(){
    return(
      <div>
     <ul class="list-group">
        <h6 className='list-group-item bg-info text-white'>Social Media</h6>
          <Test1

          media='Facebbok' 
          id='facebbok' 
          img='https://picsum.photos/60'
          />
          <Test1 

          media='Instagram ' 
          id='instagram'
          img='https://picsum.photos/61'

          />
          <Test1 

          media='Whatsap' 
          id='whatsap' 
          img='https://picsum.photos/62'
          />

          <Test1 

          media='Linkden' 
          id='linkden' 
          img='https://picsum.photos/63'
          />

    </ul>
      </div>
      
  );
  }


   
}

export default Hdr;
